pragma solidity ^0.4.24;

contract SwapTemplateRegistry {

    struct SwapTemplate {
        address owner;
        string onchainAsset;
        string onchainAccount;
        string offchainAsset;
        string offchainAccount;
        uint256 rate;  // use 18 decimals
        State state;
        Chain chain;
    }

    enum State {
        Invalid,
        Valid
    }

    enum Chain {
        Ethereum,
        Aerum
    }

    address public admin;

    bytes32[] private indexes;
    mapping(bytes32 => SwapTemplate) private templates;

    event Register(bytes32 _id);
    event Remove(bytes32 _id);

    modifier onlyOwnerOrAdmin(bytes32 _id) {
        require((templates[_id].owner == msg.sender) || (admin == msg.sender));
        _;
    }

    modifier onlyInvalid(bytes32 _id) {
        require(templates[_id].state == State.Invalid);
        _;
    }

    modifier onlyValid(bytes32 _id) {
        require(templates[_id].state == State.Valid);
        _;
    }

    constructor() public {
        admin = msg.sender;
    }

    function register(bytes32 _id, string _onchainAsset, string _onchainAccount, string _offchainAsset, string _offchainAccount, uint256 _rate, Chain _chain) external onlyInvalid(_id) {
        SwapTemplate memory template = SwapTemplate({
            owner: msg.sender,
            onchainAsset: _onchainAsset,
            onchainAccount: _onchainAccount,
            offchainAsset: _offchainAsset,
            offchainAccount: _offchainAccount,
            rate: _rate,
            state: State.Valid,
            chain: _chain
        });

        templates[_id] = template;
        indexes.push(_id);

        emit Register(_id);
    }

    function remove(bytes32 _id) external onlyValid(_id) onlyOwnerOrAdmin(_id) {
        templates[_id].state = State.Invalid;

        emit Remove(_id);
    }

    function templateById(bytes32 _id) external view returns (bytes32, address, string, string, string, string, uint256, Chain) {
        SwapTemplate storage template = templates[_id];

        return (_id, template.owner, template.onchainAsset, template.onchainAccount, template.offchainAsset, template.offchainAccount, template.rate, template.chain);
    }

    function templatesIds(Chain _chain) external view returns (bytes32[]) {
        uint256 count = countTemplates(_chain);

        bytes32[] memory ids = new bytes32[](count);

        uint256 innerIndex = 0;
        for (uint256 index = 0; index < indexes.length; index++) {
            SwapTemplate storage template = templates[indexes[index]];
            if ((template.chain == _chain) && (template.state == State.Valid)) {
                ids[innerIndex] = indexes[index];
                innerIndex++;
            }
        }

        return ids;
    }

    function countTemplates(Chain _chain) private view returns (uint256) {
        uint256 count = 0;

        for (uint256 index = 0; index < indexes.length; index++) {
            SwapTemplate storage template = templates[indexes[index]];
            if ((template.chain == _chain) && (template.state == State.Valid)) {
                count++;
            }
        }

        return count;
    }

    function templatesIdsByAsset(string _asset, Chain _chain) external view returns (bytes32[]) {
        uint256 count = countTemplatesByAsset(_asset, _chain);

        bytes32[] memory ids = new bytes32[](count);

        uint256 innerIndex = 0;
        for (uint256 index = 0; index < indexes.length; index++) {
            SwapTemplate storage template = templates[indexes[index]];
            if ((template.chain == _chain) && stringEquals(template.onchainAsset, _asset) && (template.state == State.Valid)) {
                ids[innerIndex] = indexes[index];
                innerIndex++;
            }
        }

        return ids;
    }

    function countTemplatesByAsset(string _asset, Chain _chain) private view returns (uint256) {
        uint256 count = 0;

        for (uint256 index = 0; index < indexes.length; index++) {
            SwapTemplate storage template = templates[indexes[index]];
            if ((template.chain == _chain) && stringEquals(template.onchainAsset, _asset) && (template.state == State.Valid)) {
                count++;
            }
        }

        return count;
    }

    function stringEquals(string _one, string _two) private pure returns (bool) {
        return keccak256(abi.encodePacked(_one)) == keccak256(abi.encodePacked(_two));
    }
}
